def sample_from_kde(data, n_samples, bw):
    data = np.array(data)
    u = np.random.uniform(0, 1, size=n_samples)
    i = (u * data.shape[0]).astype(np.int64)
    s = np.atleast_2d(np.random.normal(data[i], bw))[0]
    return s


